import time

# Solution code
class Solution(object):

	# 大神的代码啊，简洁、高效，果然差距！！！
	def shortestPalindrome(self, str):
		l = len(str)
		revstr = str[::-1]
		for i in xrange(l):
			if str[:(l-i+1)/2] == revstr[i:(l+i+1)/2]:
				return  revstr[:i] + str

		return  revstr[:-1] + str

	#擦，依然超时
